import React from "react";
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import ButtonBase from '@material-ui/core/ButtonBase';
import Button from '@material-ui/core/Button';
import Card from "@material-ui/core/Card";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import Divider from '@material-ui/core/Divider';



const styles = theme => ({
  root: {
    flexGrow: 1,
  },
  mainStyle: {
    paddingRight: theme.spacing.unit * 8,
    paddingBottom: theme.spacing.unit * 2,
    paddingLeft: theme.spacing.unit * 3,
    marginBottom: 5,
    maxWidth: '100%',
  },
});

class PastMeetups extends React.Component{
    render(){
      const { classes, theme} = this.props;
      console.log("props----------",this.props.posts);
    
  return (

    
    <div className={classes.mainStyle}>
       <div style={{ marginTop: 20, padding: 30 }}>
      <Grid container spacing={40} justify="center">
        {this.props.posts.map(post => (
          <Grid item key={post.title}>
            <Card>
              <CardActionArea>
                <CardContent>
                  <Typography gutterBottom variant="subtitle1">
                    {post.title}
                  </Typography>
                  <Divider />
                </CardContent>
                <CardContent>
                  <Typography gutterBottom component="p">
                    {post.title}
                  </Typography>
                  <Typography  gutterBottom component="p">{post.excerpt}</Typography>
                </CardContent>
              </CardActionArea>
              <CardActions>
                <Button size="small" color="primary" variant="contained" className={classes.button}>
                  View
                </Button>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>
    </div>
    </div>

    
    );
    }
}

export default withStyles(styles, { withTheme: true })(PastMeetups);
